import { List, ListItemButton } from "@material-ui/core";
import React from "react";

export default function SideBar() {
  return (
    <>
      <List>
        <ListItemButton>
          <ListItemIcon>
            <img
              src="https://static.wikia.nocookie.net/lolesports_gamepedia_en/images/1/10/Aorus_League.png/revision/latest?cb=20180308142104"
              alt=""
            />
          </ListItemIcon>
        </ListItemButton>
      </List>
    </>
  );
}
